"text": "<div>\n<i class=\"NoteType\">\n\u0417\u0430\u043c\u0435\u0442\u043a\u0430 \u043e \u0441\u043e\u0431\u044b\u0442\u0438\u0438\n</i>\n<div class=\"grampsstylednote\">\n<p>\n\u041e\u0442\u0434\u0435\u043b \u0417\u0410\u0413\u0421 \u043f\u043e \u0433. \u0412\u043e\u043b\u044c\u0441\u043a\u0443 \u0438 \u0412\u043e\u043b\u044c\u0441\u043a\u043e\u043c\u0443 \u0440\u0430\u0439\u043e\u043d\u0443 volsk@saratovzags.ru<br />\n10 \u043d\u043e\u044f\u0431\u0440\u044f, 15:21\n</p>\n<p>\n\u0417\u0434\u0440\u0430\u0432\u0441\u0442\u0432\u0443\u0439\u0442\u0435!  \u041f\u043e \u0412\u0430\u0448\u0435\u043c\u0443 \u0437\u0430\u043f\u0440\u043e\u0441\u0443 \u0441\u043e\u043e\u0431\u0449\u0430\u0435\u043c, \u0447\u0442\u043e \u0437\u0430\u043f\u0438\u0441\u0438 \u0430\u043a\u0442\u0430 \u043e \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0438 \u0431\u0440\u0430\u043a\u0430 \u043d\u0430 \u042e\u0440\u0437\u0430\u043d\u043e\u0432\u0430 \u0418.\u0424 \u0438 \u041d\u0430\u0437\u0430\u0440\u043e\u0432\u0443 \u0410.\u0415. \u0432 \u043e\u0442\u0434\u0435\u043b\u0435 \u0417\u0410\u0413\u0421 \u043f\u043e \u0433. \u0412\u043e\u043b\u044c\u0441\u043a\u0443 \u0438 \u0412\u043e\u043b\u044c\u0441\u043a\u043e\u043c\u0443 \u0440\u0430\u0439\u043e\u043d\u0443 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u044e\u0442. \u041a\u043d\u0438\u0433\u0438 \u0437\u0430\u043f\u0438\u0441\u0438 \u0430\u043a\u0442\u0430 \u043e \u0437\u0430\u043a\u043b\u044e\u0447\u0435\u043d\u0438\u0438 \u0431\u0440\u0430\u043a\u0430 \u0437\u0430 1919-1927\u0433\u0433 \u043f\u043e \u041a\u0443\u043b\u0438\u043a\u043e\u0432\u0441\u043a\u043e\u043c\u0443 \u0441/\u0441\u043e\u0432\u0435\u0442\u0443 \u0432 \u0430\u0440\u0445\u0438\u0432 \u043d\u0430 \u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0435 \u043d\u0435 \u043f\u043e\u0441\u0442\u0443\u043f\u0430\u043b\u0438.\n</p>\n</div>\n</div>",
